function Contacts() {
    return(
        <div className="contacts">
            <h1>Наши контакты:</h1>
            <ul>
                <li>+7 777 777 77 77</li>
                <li>+7 888 888 88 88</li>
                <li>+7 787 787 87 87</li>
            </ul>
        </div>
    ); 
}

export default Contacts;
